INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 1, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24001, 24, 0, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 1, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24002, 24, 1, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 1, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24003, 24, 2, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 2, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24004, 24, 3, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 1, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24005, 24, 4, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 2, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24006, 24, 5, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 2, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24007, 24, 6, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 4, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24008, 24, 7, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 4, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24009, 24, 8, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 4, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24010, 24, 9, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 4, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24011, 24, 10, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 4, "2020/04/30 12:00:00", 0.0, 10040, 0.0, "リン", 24012, 24, 11, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 102601);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 1, "2020/04/30 12:00:00", 1.81, 10040, 0.0, "リン", 24013, 24, 12, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 102601);
